import React from 'react'

import '../../normalize.scss'
import '../../styles/base.scss'

import NovaSenha from '../../components/RecuperaSenha/NovaSenha';
import View from "../view/view"

function NovaSenhaDoUsuario() {
  return (
    <View public={true}>
      <NovaSenha />
    </View>
  )
}

export default NovaSenhaDoUsuario;
